import exp from 'constants';
import React, { useState, useEffect } from 'react';

// --- Quiz Data ---
// This data structure uses a flat array of questions, identified by unique 'id's.
// Each answer points to the 'id' of the next question or a 'resultId'.
const quizData = [
    {
        id: "q1",
        question: "How do you solve problems?", // Question 1
        answers: [
            { text: "I break the problem into smaller pieces and solve it step by step", nextQuestionId: "q2a" },
            { text: "I manage my emotions before I try solving the problem", nextQuestionId: "q2b" },
            { text: "I reach out to a friend and talk to them about it", nextQuestionId: "q2c" },
            { text: "I reframe the problem into a positive scenario", nextQuestionId: "q2d" }
        ]
    },
    {
        id: "q2a", // Follows from q1 -> "break into smaller pieces"
        question: "How do you organize your daily tasks?", // Question 2
        answers: [
            { text: "I create daily schedules for myself", nextQuestionId: "q3aa" },
            { text: "I just live day by day without a plan", nextQuestionId: "q3ab" },
            { text: "I create a priority lists for my tasks (to-do list)", nextQuestionId: "q3ac" },
            { text: "I avoid tasks when I don't feel like doing them", nextQuestionId: "q3ad" }
        ]
    },
    {
        id: "q2b", // Follows from q1 -> "manage emotions"
        question: "How do you handle stress?", // Question 2
        answers: [
            { text: "I practice mindfulness and meditation", nextQuestionId: "q3ba" },
            { text: "I engage in physical activity", nextQuestionId: "q3bb" },
            { text: "I talk to a trusted person", nextQuestionId: "q3bc" },
            { text: "I try to distract myself", nextQuestionId: "q3bd" }
        ]
    },
    {
        id: "q2c", // Follows from q1 -> "reach out to a friend"
        question: "What role do you usually play in group settings?", // Question 2
        answers: [
            { text: "The listener", nextQuestionId: "q3ca" },
            { text: "The advice-giver", nextQuestionId: "q3cb" },
            { text: "The motivator", nextQuestionId: "q3cc" },
            { text: "The quiet observer", nextQuestionId: "q3cd" }
        ]
    },
    {
        id: "q2d", // Follows from q1 -> "reframe the problem"
        question: "How do you approach challenges?", // Question 2
        answers: [
            { text: "I see them as opportunities for growth", nextQuestionId: "q3da" },
            { text: "I look for creative solutions", nextQuestionId: "q3db" },
            { text: "I learn from my mistakes", nextQuestionId: "q3dc" },
            { text: "I try to find the silver lining", nextQuestionId: "q3dd" }
        ]
    },
    // --- Branch q3aa (from q2a -> "daily schedules") ---
    {
        id: "q3aa",
        question: "What is your education level?", // Question 3
        answers: [
            { text: "High School", nextQuestionId: "q4aaa" },
            { text: "Current College Student", nextQuestionId: "q4aab" },
            { text: "Bachelor's Degree", nextQuestionId: "q4aac" },
            { text: "Master's Degree", nextQuestionId: "q4aad" },
            { text: "PHD Degree", nextQuestionId: "q4aae" }
        ]
    },
    // --- Branch q3ab (from q2a -> "live day by day") ---
    {
        id: "q3ab",
        question: "What is your education level?", // Question 3
        answers: [
            { text: "High School", nextQuestionId: "q4aba" },
            { text: "Current College Student", nextQuestionId: "q4abb" },
            { text: "Bachelor's Degree", nextQuestionId: "q4abc" },
            { text: "Master's Degree", nextQuestionId: "q4abd" },
            { text: "PHD Degree", nextQuestionId: "q4abe" }
        ]
    },
    // --- Branch q3ac (from q2a -> "priority lists") ---
    {
        id: "q3ac",
